from typing import List

class Solution:
    def twoEditWords(self, queries: List[str], dictionary: List[str]) -> List[str]:
        arr = list()
        for q in queries:
            #sorted_q = ''.join(sorted(q))
            for word in dictionary:
                cnt = 0
                if q == word:
                    arr.append(q)
                    break
                else:
                    #sorted_word = ''.join(sorted(word))
                    #for a, b in zip(sorted_q, sorted_word):
                    for a, b in zip(q, word):
                        if a != b:
                            cnt += 1
                    if cnt <= 2:
                        arr.append(q)
                        break
        return arr
                
